import React from "react";

import SplashLogo from "../assets/gitconvex.png";

export default function SplashScreen() {
  const logoStyle = {
    "background-size": "cover",
    "background": `url(${SplashLogo})`,
    "width":"250px",
    "height":"250px"
  }
  return (
    <>
      <div className="splash-logo flex p-3 mx-auto my-auto shadow-md">
        <div className="block mx-auto my-auto p-2 splash-logo__image"
          style={logoStyle}
        ></div>
      </div>
    </>
  );
}
